import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import AppDoc from './AppDoc';
import 'bootstrap/dist/css/bootstrap.min.css';

ReactDOM.render(
  <React.StrictMode>
    <App />
    <AppDoc />
  </React.StrictMode>,
  document.getElementById('root'),
  document.getElementById('root1')
);

